ALTER TABLE `image_to_image_map` ADD COLUMN IF NOT EXISTS `translate_y` INT(10) NOT NULL DEFAULT 0 AFTER `translate_x`;

ALTER TABLE `image_to_image_map` DROP INDEX IF EXISTS `unique_image_to_image_map`;

